import React from 'react';
import ReactDOM from 'react-dom/client';
import { createBrowserRouter, RouterProvider } from 'react-router-dom';
import './index.scss';
import Main from './pages/Main/Main';
import Home from './pages/Home/Home';
import Arctic from './pages/Arctic/Arctic';
import Pilot from './pages/Pilot/Pilot';
import Polar from './pages/Polar/Polar';
import RadioArctic from './pages/Radio/RadioArctic/Radio';
import ConnectArctic from './pages/Connect/ConnectArctic/Connect';
import RadioPilot from './pages/Radio/RadioPilot/Radio';
import ConnectPilot from './pages/Connect/ConnectPilot/Connect';
import RadioPolar from './pages/Radio/RadioPolar/Radio';
import ConnectPolar from './pages/Connect/ConnectPolar/Connect';

const root = ReactDOM.createRoot(document.getElementById('root'));
const router = createBrowserRouter([
    {
        path: '/',
        element: <Main />,
    },
    {
        path: '/home',
        element: <Home />,
    },
    {
        path: '/arctic',
        element: <Arctic />,
    },
    {
        path: '/pilot',
        element: <Pilot />,
    },
    {
        path: '/polar',
        element: <Polar />,
    },
    {
        path: '/radio_arctic',
        element: <RadioArctic />,
    },
    {
        path: '/connect_arctic',
        element: <ConnectArctic />,
    },
    {
        path: '/radio_arctic',
        element: <RadioPilot />,
    },
    {
        path: '/connect_pilot',
        element: <ConnectPilot />,
    },
    {
        path: '/radio_polar',
        element: <RadioPolar />,
    },
    {
        path: '/connect_polar',
        element: <ConnectPolar />,
    },
]);
root.render(<RouterProvider router={router} />);
